import React, { useState, useEffect } from 'react';
import * as apiFunctions from '../services/foodApiFunctions';
import Header from '../components/Header';
import Footer from '../components/Footer';

function MainRecipes() {
  useState [data, setData] = useState([]);
  useState [ foodsToRender, setFoodsToRender ] = useState([]);

  useEffect(() => {
    const newData = apiFunctions.fetchAllFoodRecipes();
    setData(newData);
  }, []);

  useEffect(() => {
    console.log(data);
  }, [data]);
  return (
    <div>
      <Header title="Comidas" />
      <Footer />
    </div>
  );
}

export default MainRecipes;
